(21, 'TeresaNum', 'contact2@theonlinepublishers.com', '88121334194', 'Grow Your Business with TOP Vlogger Experts', 'Grow Your Business with TOP Vlogger Experts \r\n \r\nHow would you like to have your company\'s story told in video clips?  What better way to do that than with a series of short videos?  Welcome to the world of vlogging.  Vlogging is essentially blogging, except it is in the form of videos instead of written text.  When you are a client of The Online Publishers (TOP) we can connect you with professionals who excel at this unique type of marketing.  TOP Combines Vlogging and Influencers Marketing to boost your online reputation. \r\n \r\nClients love being able to express the highlights of their company or region through videos.  A great digital marketing firm not only knows the ins and outs of creating vlogs but knows how and where to place them to gain the maximum exposure.  Allow the vlogging gurus at TOP to do these things for you. \r\n \r\nAnother key feature of vlogging that TOP is excellent at is using social media sites to boost the videos.  All exposure that your videos can obtain through social sites is great.  Our service providers can successfully accomplish this for you.  This is especially fantastic if you need to bolster your online reputation.  Vlogs are a perfect way to do that and our providers know how to get it done right.  Go online to http://www.theonlinepublishers.com/ now and ask our support team all about it.', '2020-09-20 10:30:55'),
(22, 'PaulaKax', 'fedratewatch@gmail.com', '89565531791', 'New Government Program Offers Up to $3,252/Year Mortgage Reduction.', 'Yes, this is a cold email. But, unlike most cold emails. This one isn’t about selling you something. It’s about GIVING you something. \r\n \r\nIf you’re a homeowner this one thing can save your thousands of dollars. \r\n \r\nBanks traditionally overcharge on mortgages, profiting from homeowners. \r\n \r\nStill unknown to many there is this brilliant US government program that can benefit millions of Americans. \r\n \r\nHomeowners who have not taken advantage of the Homeowner’s Relief Savings Program (https://bit.ly/gov-relief-program) should before deadlines are announced! \r\n \r\nEligible homeowners are saving an average of 3252$/year. You can bet that banks are not thrilled about losing all that profit. \r\n \r\nThe government is making a final push and urging homeowners to take advantage. \r\n \r\nThis program is currently active but could shut down at any given time. The good news is that once you’re in, you’re in for good. It’s completely free to check if you qualify and takes 60 seconds or less. It is 100% risk-free and requires NO credit card! Just answer a few questions about your home on this page: https://bit.ly/gov-relief-program \r\n \r\nThe system will check for eligibility and give you the amount you could save as well as the step by step process to get enrolled. Yes, it is as simple as it sounds. \r\n \r\nhttps://bit.ly/gov-relief-program \r\n \r\nPro tip:  A credit score of 600+ can help you get the largest possible payout. \r\n \r\nFED Rate Watch Team', '2020-09-20 19:37:50'),
