(65, '555-555-1212', 'Try this, get more leads', '555-555-1212', 'Try this, get more leads', 'Hi, my name is Eric and I’m betting you’d like your website srisaiiot.com to generate more leads.\r\n\r\nHere’s how:\r\nTalk With Web Visitor is a software widget that’s works on your site, ready to capture any visitor’s Name, Email address and Phone Number.  It signals you as soon as they say they’re interested – so that you can talk to that lead while they’re still there at srisaiiot.com.\r\n\r\nTalk With Web Visitor – CLICK HERE http://www.talkwithcustomer.com for a live demo now.\r\n\r\nAnd now that you’ve got their phone number, our new SMS Text With Lead feature enables you to start a text (SMS) conversation – answer questions, provide more info, and close a deal that way.\r\n\r\nIf they don’t take you up on your offer then, just follow up with text messages for new offers, content links, even just “how you doing?” notes to build a relationship.\r\n\r\nCLICK HERE http://www.talkwithcustomer.com to discover what Talk With Web Visitor can do for your business.\r\n\r\nThe difference between contacting someone within 5 minutes versus a half-hour means you could be converting up to 100X more leads today!\r\n\r\nTry Talk With Web Visitor and get more leads now.\r\n\r\nEric\r\nPS: The studies show 7 out of 10 visitors don’t hang around – you can’t afford to lose them!\r\nTalk With Web Visitor offers a FREE 14 days trial – and it even includes International Long Distance Calling. \r\nYou have customers waiting to talk with you right now… don’t keep them waiting. \r\nCLICK HERE http://www.talkwithcustomer.com to try Talk With Web Visitor now.\r\n\r\nIf you\'d like to unsubscribe click here http://talkwithcustomer.com/unsubscribe.aspx?d=srisaiiot.com', '2021-01-17 13:48:15'),
(66, '01.60.06.38.77', 'Order Verified Google Reviews', '01.60.06.38.77', 'Get some Verified Google Reviews', 'Good Afternoon,\r\nI\'m ,\r\nHow are you doing regarding your Business Reviews?\r\nGoogle reviews increase trust and credibility. This might sound strange, but a huge most of 18-35-year-olds trust online reviews as much as recommendations from friends and family.\r\nhttps://jtbtigers.com/googlereviews309614\r\nKind Regards,\r\n', '2021-01-19 20:05:56'),
