(5, 'Welcome to Sri Sai Institute of Technology', 'The Sri Sai Institute of Technology is setup to impart quality education in the field of Diploma in Engineering like Mechanical Civil, Electrical Enginerring and to groom young people with knowledge and skills.\r\nSSIT is the congregation of knowledge and vision that provides a unique opportunity for students to gain insights into tomorrow’s technology.\r\n\r\n', '2020-07-12 12:02:30'),
