INSERT INTO `page` (`page_id`, `page_title`, `page_type`, `page_pubish`, `page_image`, `page_content`, `page_slug`, `page_created_at`) VALUES
(8, 'Department Of Electrical Engineering', 'academics', 1, '[\"1596097352_121e49f6f4cce757cdda.jpg\",\"ee2.jpg\"]', '<br><p><span style=\"color: rgb(51, 51, 51);\">Electrical Engineering is a field of engineering that generally deals with the study and application of electricity, electronics and electromagnetism. It covers a range of subtopics including power, electronics, control systems, signal processing and telecommunications. Electrical engineers possess an academic degree with a major in Electrical Engineering. </span></p>', 'EE-About-The-Dept', '2020-07-30 13:52:32'),
(13, 'Department of Civil Engineering', 'academics', 1, '[\"1596105438_2f6fe22aa85d2c15708e.jpg\", \"ce1.JPG\", \"ce2.JPG\", \"ce4.JPG\"]', '<p><span style=\"color: rgb(51, 51, 51);\">Civil Engineering is a Professional Engineering discipline that deals with the design, construction and maintenance of the physical and naturally built environment, including works such as bridges, roads, canals, dams and buildings. It is traditionally broken into several sub-disciplines including Environmental Engineering, Geotechnical Engineering, Structural Engineering, Transportation Engineering, Municipal or Urban Engineering, Water Resources Engineering, Materials Engineering, Surveying and Construction Engineering. </span></p>', 'CE-About-The-Department', '2020-07-30 16:07:18'),
(14, 'HOD Message', 'academics', 1, '[\"1596105682_e11ceb23479431c011d6.jpg\"]', '<p><span style=\"color: rgb(28, 30, 33);\">From Head of Department</span></p><p><span style=\"color: rgb(28, 30, 33);\">Civil Engineering</span></p><p><span style=\"color: rgb(28, 30, 33);\"> </span></p><p><span style=\"color: rgb(28, 30, 33);\">The Civil Engineering is the oldest engineering field now it is developing steadily in recent year by using software tools.</span></p><p><br></p><p><span style=\"color: rgb(28, 30, 33);\">The department aims to provide better classroom and laboratory education in the field of Civil Engineering to meet the ever growing infrastructural industry.</span></p><p><span style=\"color: rgb(28, 30, 33);\"> </span></p><p><span style=\"color: rgb(28, 30, 33);\">The Department offers study in the field of Building Science, Structural Engineering, Environmental Engineering, Surveying Engineering, Geotechnical Engineering, Hydraulics Engineering, Transportation Engineering and other fields related to Civil Engineering.</span></p><p><span style=\"color: rgb(28, 30, 33);\"> </span></p><p><span style=\"color: rgb(28, 30, 33);\">I look forward for preparing my students to face the challenges; the technology and engineering sector would offer in the future and succeed in offering technological solutions for the betterment of the society and our nation.</span></p><p><span style=\"color: rgb(28, 30, 33);\"> </span></p><p><span style=\"color: rgb(28, 30, 33);\">Wishing all our students brilliant and bright future.</span></p><p><br></p><p><span style=\"color: rgb(28, 30, 33);\">With Best Wishes,</span></p><p><span style=\"color: rgb(28, 30, 33);\">ER.SATENDER SINGH</span></p><p><span style=\"color: rgb(28, 30, 33);\">Head of the Department</span></p><p><span style=\"color: rgb(28, 30, 33);\">CIVIL ENGINEERING.</span></p><p><span style=\"color: rgb(28, 30, 33);\">E-mail : singh1995satender@gmail.com</span></p><p><span style=\"color: rgb(28, 30, 33);\">Contact no.:- 7906552024</span></p>', 'CE-HOD-Message', '2020-07-30 16:11:22'),
(15, 'HOD Message', 'academics', 1, '[\"1596106286_424018de34e4175bdbb9.jpg\"]', '<p><b><span style=\"color: rgb(28, 30, 33);\">From Head, Mechanical Engineering</b></span></p><p><br></p><p><span style=\"color: rgb(28, 30, 33);\">Department of Mechanical Engineering offers diploma course in Mechanical Engineering. We have a team of highly qualified, experienced, matured and dedicated faculty members who are committed for quality education.</span></p><p><br></p><p><span style=\"color: rgb(28, 30, 33);\">The Department has laboratory and workshop facilities with state-of-the-art equipment to carry out research in all areas related to Mechanical Engineering.</span></p><p><br></p><p><span style=\"color: rgb(28, 30, 33);\">Our objective is not to merely produce professionals capable to serve their own needs but Endeavour to serve the society with great concern for human values.</span></p><p><br></p><p><span style=\"color: rgb(28, 30, 33);\">I wish success to all students in our endeavor to join us on the journey of quality education & to have a great learning experience with my excellent, loving & caring team.</span></p><p><br></p><p><br></p><p><span style=\"color: rgb(28, 30, 33);\">Best Wishes</span></p><p><span style=\"color: rgb(28, 30, 33);\">Jyoti Pant</span></p><p><span style=\"color: rgb(28, 30, 33);\">Head, Dept. of Mechnical Engineering</span></p><p><span style=\"color: rgb(28, 30, 33);\">Sri Sai Institute of Technology</span></p><p><span style=\"color: rgb(28, 30, 33);\">Mahuadabra</span></p><p><span style=\"color: rgb(28, 30, 33);\">Jaspur(USN)</span></p><p><span style=\"color: rgb(28, 30, 33);\">Email: jyotipant99@gmail.com</span></p><p><span style=\"color: rgb(28, 30, 33);\">Contact @ 8433250908</span></p><p> </p>', 'ME-HOD-Message', '2020-07-30 16:21:26'),
(16, 'Department of Mechanical Engineering', 'academics', 1, '[\"1596106953_c2fa377d391717bf87f3.jpg\", \"me1.JPG\", \"me2.JPG\"]', '<p><span style=\"color: rgb(51, 51, 51);\">Mechanical Engineering is an engineering discipline that was developed from the application of principles from physics and materials science. According to the American Heritage Dictionary, it is the branch of engineering that encompasses the generation and application of heat and mechanical power and the design, production, and use of machines and tools. It is one of the oldest Engineering disciplines.</span></p>', 'ME-About-The-Department', '2020-07-30 16:32:33'),
(19, 'Placement', '', 1, '[\"1649327642_99e611f00f331abe6974.jpg\"]', '<p><strong style=\"color: rgb(51, 51, 51);\">Placement Assistance </strong></p><p><br></p><p><a href=\"https://srisaiiot.com\" target=\"_blank\" style=\"color: rgb(51, 51, 51);\"><strong>Sri Sai Institute of Technology</strong></a><span style=\"color: rgb(51, 51, 51);\"> enjoys a healthy association with recruiters across the country. The placement cell constantly endeavors to stabilize these associations into long-term relationships. Our Placement cell comprises of eminent people from the Industry who help in preparing the students for their careers by mentoring them students and also by guiding them in deciding on various strategies on placements. </span></p><p><br></p><p><strong style=\"color: rgb(51, 51, 51);\">Placement Protocol and Support @ SSIT</strong></p><p><br></p><ul><li><span style=\"color: rgb(51, 51, 51);\">Students\' Attendance as per Norms.</span></li><li><span style=\"color: rgb(51, 51, 51);\">SSIT organizes Seminars, Guest Lectures, Workshops, and Industrial tours for the students to bridge the gap between academics and industry.</span></li><li><span style=\"color: rgb(51, 51, 51);\">On-Campus and Off-Campus recruitment drives.</span></li><li><span style=\"color: rgb(51, 51, 51);\">Assist the students in their summer training projects.</span></li><li><span style=\"color: rgb(51, 51, 51);\">Trained students as per Industry needs.</span></li><li><span style=\"color: rgb(51, 51, 51);\">Clear Pass students shall be appearing for the Interview Session.</span></li><li><span style=\"color: rgb(51, 51, 51);\">A number of choices for job opportunities.</span></li></ul><p><br></p><p><strong style=\"color: black;\">Some of our prominent recruiters</strong></p><p><strong>1.    <em>Bajaj Motors, Haridwar (U.K)</em></strong></p><p><strong><em>2.    Jaya Infra Projects, Delhi</em></strong></p><p><strong>3.    <em>Schneider Electric, Pantnagar (U.K)</em></strong></p><p><strong>4.    <em>Lohaar Constructions, Kashipur (U.K)</em></strong></p>', 'Placement', '2022-04-07 16:04:02'),
(20, 'AS About The Department', 'academics', 1, '[\"1649328062_13f00da001abf44eca5a.jpg\"]', '<p><span style=\"color: rgb(51, 51, 51);\">The aims of department is a holistic development of the first year engineering students. It prepares the students for higher studies required specifically for industries by imparting knowledge on the fundamental principles of Physics, Chemistry, Mathematics & Professional Communication. The courses taught by the teachers of this department lay the foundation of engineering sciences.</span></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">Professional communication is of particular importance for improving the Verbal and Written skills of students. An understanding of Physics and Chemistry is essential to several engineering subjects like electronics, electrical engineering and engineering materials. Mathematics is undisputedly important in all fields of engineering.</span></p>', 'AS-About-The-Department', '2022-04-07 16:11:02'),
(21, 'HOD Message', 'academics', 1, '[\"1649328371_289f45832587dd373cdf.jpg\"]', '<p><strong style=\"color: rgb(28, 30, 33);\"><u>Deptt. of Applied Sciences welcomes you in the family of SSIT.</u></strong></p><p><br></p><p><span style=\"color: rgb(28, 30, 33);\">It plays a vital role in an engineering discipline, catering to the teaching of basic Sciences for students of all branches offered by college (Mechanical, Electrical, Civil Engg).</span></p><p><span style=\"color: rgb(28, 30, 33);\">The purpose of applied sciences in Engineering study is to lay a strong foundation of basic principles of various disciplines such as *Mathematics, Physics, Chemistry, Communication Skills and Engineering Drawing* in the mind of the learners, so that they proceed to rest of their years of study with up to date knowledge and training of basic engineering skills.</span></p><p><br></p><p><span style=\"color: rgb(28, 30, 33);\">Our Laboratories are very well established .We not only to cover complete syllabus but also motivate students to learn beyond the syllabus which definitely develops complete knowledge of the subject (both the practical and theoretical depth of knowledge) and develop skill sets of students to become promising engineers in future, thus the Department of Applied Sciences (1st year Department) acts as a fertilizer to develop a good base for student’s, personality and skills.</span></p><p><br></p><p><span style=\"color: rgb(28, 30, 33);\">This is the backbone of all disciplines in Engineering and Technology.</span></p><p><span style=\"color: rgb(28, 30, 33);\">I wish success and bright future to all the students.</span></p><p><span style=\"color: rgb(28, 30, 33);\">Best wishes</span></p><p><span style=\"color: rgb(28, 30, 33);\">Mohit Kumar</span></p><p><span style=\"color: rgb(28, 30, 33);\">Head, Department of Applied sciences</span></p><p><span style=\"color: rgb(28, 30, 33);\">Sri Sai Institute of Technology</span></p><p><span style=\"color: rgb(28, 30, 33);\">Mahuadabra</span></p><p><span style=\"color: rgb(28, 30, 33);\">Jaspur (Udham Singh Nagar)</span></p><p><span style=\"color: rgb(28, 30, 33);\">Email:- pawarmohit155@gmail.com</span></p><p><span style=\"color: rgb(28, 30, 33);\">Contact@ 7895224101</span></p>', 'HOD-Message', '2022-04-07 16:16:11'),
(22, 'Applied Science HOD', 'academics', 1, '[\"1649328823_a72793ddfffadb9c18e0.jpg\"]', '<p><strong style=\"color: rgb(28, 30, 33);\"><u>Deptt. of Applied Sciences welcomes you in the family of SSIT.</u></strong></p><p><br></p><p><span style=\"color: rgb(28, 30, 33);\">It plays a vital role in an engineering discipline, catering to the teaching of basic Sciences for students of all branches offered by college (Mechanical, Electrical, Civil Engg).</span></p><p><span style=\"color: rgb(28, 30, 33);\">The purpose of applied sciences in Engineering study is to lay a strong foundation of basic principles of various disciplines such as *Mathematics, Physics, Chemistry, Communication Skills and Engineering Drawing* in the mind of the learners, so that they proceed to rest of their years of study with up to date knowledge and training of basic engineering skills.</span></p><p><br></p><p><span style=\"color: rgb(28, 30, 33);\">Our Laboratories are very well established .We not only to cover complete syllabus but also motivate students to learn beyond the syllabus which definitely develops complete knowledge of the subject (both the practical and theoretical depth of knowledge) and develop skill sets of students to become promising engineers in future, thus the Department of Applied Sciences (1st year Department) acts as a fertilizer to develop a good base for student’s, personality and skills.</span></p><p><br></p><p><span style=\"color: rgb(28, 30, 33);\">This is the backbone of all disciplines in Engineering and Technology.</span></p><p><span style=\"color: rgb(28, 30, 33);\">I wish success and bright future to all the students.</span></p><p><span style=\"color: rgb(28, 30, 33);\">Best wishes</span></p><p><span style=\"color: rgb(28, 30, 33);\">Mohit Kumar</span></p><p><span style=\"color: rgb(28, 30, 33);\">Head, Department of Applied sciences</span></p><p><span style=\"color: rgb(28, 30, 33);\">Sri Sai Institute of Technology</span></p><p><span style=\"color: rgb(28, 30, 33);\">Mahuadabra</span></p><p><span style=\"color: rgb(28, 30, 33);\">Jaspur (Udham Singh Nagar)</span></p><p><span style=\"color: rgb(28, 30, 33);\">Email:- pawarmohit155@gmail.com</span></p><p><span style=\"color: rgb(28, 30, 33);\">Contact@ 7895224101</span></p>', 'Applied-Science-HOD', '2022-04-07 16:23:43');
